import './index.css';
import React from "react";
import {render} from "react-dom";
import {BrowserRouter, Route, Routes, Link} from "react-router-dom";
import Navbar from "./Navbar.js";
import Home from "./Home.js";
import About from "./About.js";
import Products from "./Products.js";
import ProductDetails from "./ProductDetails.js";
import Cart from "./Cart.js";

function App() {
  return (
  <>
  <BrowserRouter>

    <Navbar />

    <Routes>
      <Route path="/*" element={<div className="container"><Home/></div>} />
      <Route path="/about/*" element={<div className="container"><About/></div>} />
      <Route path="/products/*" element={<div className="container"><Products/></div>} />
      <Route path="/cart/*" element={<div className="container"><Cart/></div>} />
      <Route path="/products/:id/" element={<div className="container"><ProductDetails/></div>}>
      <Route path={`/products/${product.id}/`} element={<ProductDetailInfo price={product.price} description={product.description}/>} />
        <Route path={`/products/${product.id}/nutrition/*`} element={<ProductDetailNutrition {...product.nutrition}/>} />
        <Route path={`/products/${product.id}/storage/*`} element={<ProductDetailStorage storage={product.storage}/>} />
      </Route>
    </Routes>

  </BrowserRouter>
  </>);
}

render(<App />, document.getElementById("root"));
